        <div>
            <h1>hola mundo</h1>
            <TaskCard />
            Next stars: {stars}
        </div>
    )
}

index.getInitialProps = async (ctx) => {
   const res = await fetch('https://my-json-server.typicode.com/lozcep/infotest/posts')

    const json = res
    console.log(json)
    return { stars: json }
  }

export default index
